Это было в 2007 и 2008 году.
+ близко Ж/Д, вокзал, остановка;
+ хороший шведский стол на завтрак;
+ нормальные кровати;
+ аккуратный номер, хоть и не в стиле "евро";
+ есть тренд к улучшению ремонта и сервиса;
- в номерах появляется ощущение эпохи 80-90х;
- "странные" звонки в номера;
- как то случилось так, что небыло холодной воды;
- нет кондиционера (возможно уже есть);
Если не придираться, то недельку пожить можно, а за неделю, как известно, даже шведский стол может наскучить.

Ездим на эту гору уже второй год. Всего были на 3х горах. Что нравится: 
1) это полноценный комплекс для хорошего отдыха: чистый воздух, гостиница, бассейн, прокат инвентаря, инструкторы, несколько кафе, доброжелательный персонал, наличие банкоматов; 
2) бесплатная большая парковка; 
3) высококлассные инструкторы. Брала 2 часа, меня научили перекантовываться, поставили на доску, достаточно понятно все объяснили. Училась также на Волчихе, но там инструктор не мог мне объяснить доступным языком что и как надо делать. Также аблюдала за другими инструкторами, многие отлично работают с детьми, вкладывают всю душу;
4) кресельный подъемник на туристическуютрассу, у которого закрывается вся кабина. Это очень удобно, т.к. не дует ветер, есть возможность отдохнуть; 
5) наверху есть смотровая площадка, собака-хаски. это конечно не основополагающий плюс, но приятно; 
6) наличие мест для хранения инвентаря, в том числе и под "охраной", при чем бесплатно; 
7) хорошие уборные;
8) рано утром есть возможность после выпавшего ночью снега покататься в лесу по пухляку.

Из минусов: 
1) достаточно долгая дорога из Екатеринбурга; 
2) очень высокие цены на блюда в кафе + нет безналичного расчета; 
3) не играет музыка на склонах, а так хочется праздника; 
4) недешевые спуски единоразовые - 90 руб.\спуск в выходные. Выгоднее брать на 2 или 5 часов, но новичкам столько не накатать; 
5) на туристической трассе примерно 10 м в самом начале сплошной лед, снег сдувается, поэтому стартовать не комфортно; 
6) если вы приезжаете рано утром кататься, в это время трасса после спец. техники разровнена, если попадаешь в канавки, справиться с управлением тяжело. Зато на трассе будешь скорее всего один.

Каждая поездка, каждая каталка - это праздник, т.к. глаза отдыхают от городских джунглей, любуются нереально красивыми видами и елями, а если выезжать рано утром, то можно еще застать и волшебный рассвет.

Пишу отзыв как человек, побывавший на горе все выходные с семьей и друзьями. И как человек, вставший на горные лыжи 2ой раз в жизни. Чайничек я)))

Понравилось:
- наличие различных по сложности трасс. Пообщалась с друзьями лыжниками, которые уже своих детей поставили на лыжи, гора Белая- самый идеальный вариант для обучения малышей... Ну и для меня тоже) Трасса для начинающих широкая и достаточно длинная я считаю, мне понравилось) Плюс цены адекватные;
- 4-местный кресельный подъемник. На нем мне больше понравилось кататься, чем с горки, к которой он привозит😄 ;
- бублики с подъемником. Дада:) Прикрываясь старшей дочерью, что типа мы с ней за компанию, чтобы она не испугалась, проехался даже муж пару раз)) ;
- наличие бассейна порадовало. Только мы в нем не купались- все купальные труселя дома оставили и даже взять не подумали) Зато сходили друзья- довольны;
- сауна, в которой полы с подогревом- с малышами, которые в силу возраста ведут напольный образ жизни, это оч кстати. Да и папы от сауны были довольны;
- в здании проката на 2 этаже есть детская комната (150р/ч). В прошлом году в сильно ветренную погоду она была для нас спасением;
- бесплатный wi-fi;

Не понравилось:
- Я считаю дикий ценник в кафе- во всех кафе на горе(ассортимент везде один и тот же). Ну не стоит предложенное в меню заявленной цены! Добил ломтик от брикета мороженого с фруктами за 150р, поданный на большой плоской тарелке(!!!)😄 с десертной ложечкой. Какбэээ мороженка же вроде в креманках подается))) Наколупать с такого блюда такой ложечкой и фрукты было сложно даже мне) что уж говорить о дочери) Видимо, персонал оч любит басни и решил попрактиковать на нас "Лису и Жураля"! Ну и по остальным блюдам - полуфабрикаты, заморозка. Не всё, конечно, есть там и собственного производства многое... Но цена явно завышена;
- нет детских высоких стульчиков в кафе. Хотя с детьми, с колясками было оч много людей;
- цена на номера в гостинице. За 2 ночи 2-местный номер с доп местом у нас вышел на 8800руб (7200р номер на 2 суток + 1600руб доп место для дочери-раскладушка, тоже на 2 суток). Но бесплатно дали манеж-кровать для мелкого(что приятно было). Ах да- еще завтраки были включены.
Именно за эти ценовые моменты и ставлю 4 звезды.

В общем, мы так подумали, что в Турцию/Египет слетать на выхи будет дешевле😄 да и сами первостепенные услуги на горе для нас-прокат и подъемники, бублики и детская комната оказались в разы дешевле, чем второстепенные(кафе и гостиница). В следующий раз мы решили ехать только на день и со своим чаем/печеньками:) 

Заключение: 
От горы я в восторге, дочь в восторге) Муж доволен, что мы довольны)
От цен на гостиницу и в кафе я в недоумении, муж в недоумении) Дочь не всю еду оценила на "вкусно".
